import colorsys

import dag


color = dag.app("color", help = "Test various functions involving the formatting and displaying of color")


	
@color.cmd
def hls(h: int = 0, l: int = 255, s: int = 255):
	r,g,b = colorsys.hls_to_rgb(h/255, l/255, s/255)
	return f"<c #{int(r*255):02x}{int(g*255):02x}{int(b*255):02x}>Test Message</c>"


@color.arg.Msg("msg")
@color.cmd
def rawformat(msg = ""):
	dag.echo("Ignore b'\\ if the below includes it at the beginning.\nProper sequence begins with a single \\\n")
	dag.echo(str(dag.rawformat(msg).encode('unicode_escape')))


	
# Here, "ctag ..." or "color ctag ..." calls the same function
@dag.cmd
@color.cmd
def ctag(*styles, message = "TEST MESSAGE"):
	"""Test a ctag with multiple styles"""
	return f"<c {' '.join(styles)}>{message}</c>"


@ctag.cmd
@color.cmd
def empty():
	"""Test Empty String to make sure it's formatting"""
	return "<c>Test Empty</c>"
	

@color.cmd
def colors(color = ""):
	"""Show all colors"""
	return [col for col in list(dag.get_terminal().colormap) + list(dag.colors.htmlcolornames) if color in col]


@color.cmd
def htmlcolors(color = ""):
	"""Show all colors"""
	return [(k, v) for k,v in dag.colors.htmlcolornames.items() if color in k]

		

@htmlcolors.display
def display_htmlcolors(response, formatter):
	for i in range(0, len(response), 4):
		col1 = response[i]
		col2 = response[i+1] if i+1 < len(response) else ("", "")
		col3 = response[i+2] if i+2 < len(response) else ("", "")
		col4 = response[i+3] if i+3 < len(response) else ("", "")

		formatter.add_row(f"<c {col1[1]}>█ - {col1[0]}</c>", f"<c {col2[1]}>█ - {col2[0]}</c>", f"<c {col3[1]}>█ - {col3[0]}</c>", f"<c {col4[1]}>█ - {col4[0]}</c>")


@color.cmd("8bit")
def _8bit(color: dag.Color = "#FF0001") -> str:
	return color.bit8.hexstring


@colors.display
def display_colors(response, formatter):
	for i in range(0, len(response), 4):
		col1 = response[i]
		col2 = response[i+1] if i+1 < len(response) else ""
		col3 = response[i+2] if i+2 < len(response) else ""
		col4 = response[i+3] if i+3 < len(response) else ""

		formatter.add_row(f"<c {col1}>█ - {col1}</c>", f"<c {col2}>█ - {col2}</c>", f"<c {col3}>█ - {col3}</c>", f"<c {col4}>█ - {col4}</c>")


@color.cmd
def hex(color: dag.Color):
	return color.hexstring
	

@color.arg.GreedyWords("message", help = "This will be printed when testing the color")	
@color.arg("color", help = "The name of the color that will be outputted")
@color.DEFAULT.cmd(value = dag.args.color)
def xterm(color: dag.Color = "#ff000a", message = "TEST"):
	"""Test colorstrings"""
	return


@xterm.display
def display_xterm(response, formatter, parsed):
	return response.ctag(parsed.message)
		

